Material:100% genuine cowhide<br>Length:Strap length is 46.0 to 49.0'' to adjustable by leather pieces in the front<br>Width:2.0'' (5.1 cm)<br>Attachment Method:Back buckles through camera's strap lugs<br>Quick release clasps on back buckles for rapid removal of the strap<br><br><br>・Soft  heavy-duty 100% genuine cowhide<br>・Wide shoulder pad<br>・Quick release clasps located on the leather attachments that fit through camera's strap lugs<br>・Leather bound sides for smooth comfort around your neck<br>・Can also be worn on one shoulder<br><br><br>The Heavy Leather NYC Classic Leather Camera Strap (Distressed Red) is not just your ordinary strap. This is a heavy-duty strap built for long-term durability as well as style. The Classic strap length is 46 to 49'' adjustable by leather pieces in the front.<br><br>The shoulder pad is 2.0'' wide and designed for comfort. The 100% cowhide material is chosen so that no two straps will appear the same giving each Classic a stamp of originality. Attaching it to your camera is easy using the back buckled leather straps that fit through the lugs on your camera body. This provides a secure fit and can easily be removed using the quick release clasps on each side of the leather back buckled straps.</DIV>
